import React, {useState} from 'react';
import { SearchNumContaner } from './CardCar.styled';
import Form from 'react-bootstrap/Form';
import "./styles.css"
import Button from 'react-bootstrap/Button';

 interface SearchInter{
  onSearch:string
}


interface SearchProps {
  onSearch: (number: string) => void;
}

const Search: React.FC<SearchProps> = ({ onSearch }) => {
  const [number, setNumber] = useState('');

  const handleSearch = () => {
    onSearch(number);
  };

  return (
    <SearchNumContaner>
      <Form.Label htmlFor="inputPassword5"  id = "LabelEnterNum">Введите номер</Form.Label>
      <div className='containerSearch'>
          <Form.Control  value={number}   onChange={(e) => setNumber(e.target.value)} />
          <Button variant="success" onClick={handleSearch}>Поиск</Button>
      </div>
      <Form.Text id="passwordHelpBlock" className = "passwordHelp">
        Номер дожен соответсвовать регламентам Украины
      </Form.Text>
    </SearchNumContaner>
  );
}
export default Search;
